import React from "react";
// import logo from "./logo.svg";
import "./App.css";
import Header from "./header";
import NavBar from "./navBar";
import SearchCard from "./searchCard";

const App = () => {
  const changeBackgroundImg = () => {};
  return (
    <div className="App">
      <Header />
      <NavBar />
      <SearchCard prop={changeBackgroundImg} />
    </div>
  );
};

export default App;
